export const styles={
    event:{
        height: 273,
        background: "#C1D37F",
        position: "relative"
    },
    eveFont:{
        height: 33,
        color: "#FFFFFF",
        marginTop: 12,
        lineHeight: "24px"
    },
    eveNameFont:{
        height: 57,
        color: "#000000",
        position: "absolute",
        top: 172,
        left: "12.96%",
        lineHeight: "57px",
        fontSize: 42
    },
    flex:{
        display: "flex"
    },
    posiWrap:{
        display: "flex",
        marginLeft: "7.29%",
        marginTop: 49
    },
    Nlink:{
        textDecoration: "none",
        color: "#FFFFFF",
        "&:active": {
            color: "#FFFFFF"
        }
    }
}
